        renderer.setSize(window.innerWidth, window.innerHeight);

        renderer.shadowMap.type = THREE.PCFSoftShadowMap;
        document.body.appendChild(renderer.domElement);

        const scene = new THREE.Scene();

        // ✅ กล้อง
        const camera = new THREE.PerspectiveCamera(
            75,
            window.innerWidth / window.innerHeight,
            0.1,
            1000
        );
        camera.position.set(0, 2, 15);
        camera.lookAt(0, 0, 0);
        const controls = new THREE.OrbitControls(camera, renderer.domElement);

        const directionalLight = new THREE.DirectionalLight(0xffeedd, 0.9); // แสงทิศทาง
        directionalLight.position.set(10, 5, 10);
        directionalLight.castShadow = true;
        scene.add(directionalLight);

        const pointLight = new THREE.PointLight(0xffeedd,1);
        pointLight.position.set(0, 0, 0);
        pointLight.castShadow = true;
        scene.add(pointLight);

        const spotLight = new THREE.SpotLight(0xffeedd,1);
        spotLight.position.set(0, 0, 0);

        directionalLightFolder.add(directionalLight.position, 'z', -100, 100);

        const geom = new THREE.BufferGeometry();
        geom.setAttribute('position', new THREE.Float32BufferAttribute(FaceVertices, 3));
        geom.setAttribute('uv', new THREE.Float32BufferAttribute(FaceUvs, 2));
        geom.computeVertexNormals();

        const tex = new THREE.TextureLoader().load('https://touchzaza1111.github.io/Modeling/gude_face2.png', t => {
            t.flipY = false; 
            t.encoding = THREE.sRGBEncoding;
        });

        const texwood = new THREE.TextureLoader().load('https://touchzaza1111.github.io/Modeling/Material_albedo.jpg', t => {
            t.flipY = false; 
            t.encoding = THREE.sRGBEncoding;
        });

        const mat = new THREE.MeshStandardMaterial({
            map: tex, 
        });

        // 3) ใส่เพิ่มในฉาก
        const mesh = new THREE.Mesh(geom, mat);
        mesh.castShadow = true;
        mesh.receiveShadow = true;
        scene.add(mesh);

        const Yolk_geometry = new THREE.BufferGeometry();
        Yolk_geometry.setAttribute('position', new THREE.Float32BufferAttribute(YolkVertices, 3));
        Yolk_geometry.computeVertexNormals();

        const Yolk_material = new THREE.MeshStandardMaterial({ 
            color: 0xffd247 ,
            roughness : 0.6,
            metalness : 0,
            transparent: true,
            alpha: 1
        }); // MAKE MAT
        const Yolk_mesh = new THREE.Mesh(Yolk_geometry, Yolk_material);
        scene.add(Yolk_mesh);

        const White_geometry = new THREE.BufferGeometry();
        White_geometry.setAttribute('position', new THREE.Float32BufferAttribute(WhiteVertices, 3));
        White_geometry.computeVertexNormals();

        const White_material = new THREE.MeshStandardMaterial({ 
            color: 0xE3DCDC,
            roughness : 0.6,
            metalness : 0,
            transparent: true,
            opacity: 0.3
        }); // MAKE MAT
        const White_mesh = new THREE.Mesh(White_geometry, White_material);
        scene.add(White_mesh);

        const chopsticks_geometry = new THREE.BufferGeometry();
        chopsticks_geometry.setAttribute('position', new THREE.Float32BufferAttribute(chopsticksVertices, 3));
        chopsticks_geometry.computeVertexNormals();

        const chopsticks_material = new THREE.MeshStandardMaterial({ 
            color: 0xE3DCDC,
            roughness : 0,
            metalness : 1
        }); // MAKE MAT
        const chopsticks_mesh = new THREE.Mesh(chopsticks_geometry, chopsticks_material);
        scene.add(chopsticks_mesh);

        const bowl_geometry = new THREE.BufferGeometry();
        bowl_geometry.setAttribute('position', new THREE.Float32BufferAttribute(bowlVertices, 3));
        bowl_geometry.computeVertexNormals();

        const bowl_material = new THREE.MeshStandardMaterial({ 
            color: 0xE3DCDC,
            roughness : 0,
            metalness : 1
        }); // MAKE MAT
        const bowl_mesh = new THREE.Mesh(bowl_geometry, bowl_material);
        bowl_mesh.scale.set(0.5,0.5,0.5);
        bowl_mesh.position.set(1,-5,3);
        scene.add(bowl_mesh);

        const crackegg_geometry = new THREE.BufferGeometry();
        crackegg_geometry.setAttribute('position', new THREE.Float32BufferAttribute(crackeggVertices, 3));
        crackegg_geometry.computeVertexNormals();

        const crackegg_material = new THREE.MeshStandardMaterial({ 
            color: 0xE3DCDC,
            roughness : 1,
            metalness : 0
        }); // MAKE MAT
        const crackegg_mesh = new THREE.Mesh(crackegg_geometry, crackegg_material);
        crackegg_mesh.scale.set(0.5,0.5,0.5);
        crackegg_mesh.position.set(1,-5,3);
        scene.add(crackegg_mesh);

        const loader = new THREE.OBJLoader();
        loader.load('https://touchzaza1111.github.io/Modeling/stylized_low-poly_wood_table.obj', function (object) {
            object.castShadow = true; // ✅ วัตถุนี้สร้างเงา
            // ตั้งค่า castShadow กับทุก mesh ใน object
            object.traverse(function (child) {
                if (child.isMesh) {
                    child.castShadow = true;
                    child.receiveShadow = true;
                    child.material = new THREE.MeshStandardMaterial({
                         // เพื่อให้แสดงสีที่ถูกต้องจาก texture
                        map: texwood, // ตัวแปร texture ของไม้
                        roughness: 7, // ค่า roughness ของไม้
                        metalness: 0
                    });
                }
            });
            object.scale.set(0.1, 0.1, 0.1); // ✅ ลดขนาดของโมเดล
            object.position.set(0, -23, 0);
            scene.add(object);
        }, undefined, function (error) {
            console.error('Error loading OBJ:', error);
        });


        // ✅ render loop
        function animate(t) {

            renderer.render(scene, camera);
            requestAnimationFrame(animate);
        }
        animate(0);

        window.addEventListener('keydown', (event) => {

        });

    </script>
</body>

</html>
